import React, { useContext } from 'react'
import { Link } from 'react-router-dom'
import AuthContext from '../context/AuthContext'

const Header = () => {
  let {user, logoutUser} = useContext(AuthContext)

  const loginAndRegisterComp = <div><Link to='/login'>Login</Link><span>|</span><Link to='/register'>Register</Link></div>
  const homeAndLogoutComp = <div><Link to='/'>Home</Link><span>|</span><span onClick={logoutUser}>Logout</span></div>

  return (
    <div>
      {user ? <div><span>Hello userId: {user.user_id} !</span>{homeAndLogoutComp}</div> : loginAndRegisterComp}
    </div>
  )
}

export default Header
